import logo from './logo.svg';
import './App.css';

function App() {
  return (
    document.style = 'background: red;',
    <div className="App" height= "100%">
      <body>
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Hello There</h1>
      </body>
    </div>
  );
}

export default App;
